import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import CartSummary from '../Main/CartSummary';

export default class navi extends Component {
  read = () => {
    return console.log(this.props.addedincart)

  }
  render() {
    return (
      <div>
        <nav class="navbar navbar-expand-lg navbar-light bg-light">
          <div class="container-fluid">
            <div class="collapse navbar-collapse" id="navbarNav">
              <a class="navbar-brand" href="">Product Tracking System {this.read()}</a>
            </div>
            <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
              <span class="navbar-toggler-icon"></span>
            </button>
            <CartSummary addedincart={this.props.addedincart.length} products={this.props.addedincart}/>
          </div>
        </nav>
      </div>
    )
  }
}
